import Link from 'next/link'
import { NextPage } from 'next'

const linkStyle = {
  marginRight: 15
}

interface HeaderProps {
    userAgent?: string,
}

const Header: NextPage<HeaderProps> = ({ userAgent }) => {
  return (
    <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </div>
  )
}

export default Header
